// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract GoldSeek3 {
     uint256 constant public tokenPriceInitial_ = 0.00002 ether;
     uint256 constant internal tokenPriceIncremental_ = 0.000002 ether;
     
     uint256 constant internal magnitude = 2**64;
    mapping (address => uint256) public _holderBalances;
    mapping (address => uint256) public _holderPaidOUt;
    mapping (address => uint256) public _divCredits;
    mapping (address => uint256) public _holderPersonalEth;
    mapping (address => uint256) public _ReferralCommission;
    mapping (address => address) public _referrerMapping;
uint256 public _existingPrice = tokenPriceInitial_;
    address public owner;
//    uint256 public RSupply;
    uint256 public TotalEthStaked;
    address _admin = 0x7cfa8CD3DA48dE9D86aD221662f38A1295D177eC;  //0xb27A5715DeE0B91CC60da06c1bb860aBa44DB804  
//    address _Referer = 0x412fc8F58D2c68D5C1c7A011660aefA5f261d862;
 //   address I_Referer = 0x7cfa8CD3DA48dE9D86aD221662f38A1295D177eC;
    uint256 commission = 25;
    uint256 redistribution = 10;
    uint256 direcREferCommission = 7;
    uint256 inDirecREferCommission = 3;
    uint256 adminFee = 5;
    uint256 SellingCommission = 7;
    uint256 public rateOfDiv;
    uint256 public DividendPool;

 //   uint256 public DividendPerToken;
    
    uint256 public TotalSupply = 0;
    uint256 public DivSupply = 0;
    
    constructor (){
        owner = msg.sender;
    }
    
    
    event Buy (address buyer, uint256 amount);
    function buy(address referrer)public payable {
        
        (
          uint256 tTransfer,
          uint256 dist,
         uint256 drc,
         uint256 Idrc,
         uint256 afee) = getTValues(msg.value);
        
         require(msg.value>=0.1 ether,"amount must be greather than 0.001 BNB");
         uint256 price = existingPrice();
         uint256 Purremainder = tTransfer%price;
         uint256 tokenValue = tTransfer - Purremainder;
         uint256 tokenQty = tokenValue / price;
        address indRferrer = _referrerMapping[referrer];
        
        _holderBalances[msg.sender] += tokenQty;
        _divCredits[msg.sender] += tokenQty;
        _ReferralCommission[_admin] += afee;
    
        if(referrer != 0x0000000000000000000000000000000000000000)
            {_ReferralCommission[referrer] += drc;
              _referrerMapping[msg.sender] = referrer;
                if(indRferrer != 0x0000000000000000000000000000000000000000){_ReferralCommission[indRferrer] += Idrc;}
                else{_ReferralCommission[_admin]+=Idrc;}
            }
        else{_ReferralCommission[_admin]+= drc; _ReferralCommission[_admin]+= Idrc;}
        

    
        
        TotalSupply += tokenQty;
        DivSupply += tokenQty;
        processDiv(dist);
        TotalEthStaked += msg.value;
        _existingPrice = _existingPrice + (msg.value*tokenPriceIncremental_/1000000000000000000);
        
//        processEthStocked(msg.value,true);
        
        emit Buy(msg.sender,tokenQty);
        
        }
        

    function reinvest() public {
        uint256 amount = dividendBalance(msg.sender) + _ReferralCommission[msg.sender];
        
        
        (
          uint256 tTransfer,
          uint256 dist,
         uint256 drc,
         uint256 Idrc,
         uint256 afee) = getTValues(amount);
        

         uint256 price = existingPrice();
         uint256 Purremainder = tTransfer%price;
         uint256 tokenValue = tTransfer - Purremainder;
         uint256 tokenQty = tokenValue / price;
         address referrer = _referrerMapping[msg.sender];
         address indRferrer = _referrerMapping[referrer];
        
        _holderBalances[msg.sender] += tokenQty; 
        _divCredits[msg.sender] += tokenQty; 
        _ReferralCommission[_admin] += afee;
    
        if(referrer != 0x0000000000000000000000000000000000000000)
            {_ReferralCommission[referrer] += drc;

                if(indRferrer != 0x0000000000000000000000000000000000000000){_ReferralCommission[indRferrer] += Idrc;}
                else{_ReferralCommission[_admin]+=Idrc;}
            }
        else{_ReferralCommission[_admin]= drc; _ReferralCommission[_admin]= Idrc;}
        

    
        
        TotalSupply += tokenQty;
        DivSupply += tokenQty;
        processDiv(dist);
        TotalEthStaked += amount;
        _existingPrice = _existingPrice + (amount*tokenPriceIncremental_/1000000000000000000);
        
//        processEthStocked(msg.value,true);
        _holderPaidOUt[msg.sender] += dividendBalance(msg.sender);
        _ReferralCommission[msg.sender] = 0;
        emit Buy(msg.sender,tokenQty);
        
    }
    
    function existingPrice() view public returns(uint256){
        if(TotalSupply==0 || _existingPrice < tokenPriceInitial_){return tokenPriceInitial_;}
        else{return _existingPrice;}
    }
    
    function SaleexistingPrice() view public returns(uint256){
        uint256 price1 = tokenPriceInitial_*80/100;
        uint256 price2 = _existingPrice*80/100;
        if(TotalSupply==0 || _existingPrice < tokenPriceInitial_){return price1;}
        else{return price2;}
    }   
    
    uint256 public valueforSale;
    uint256  public tTransferPUblic; 
    uint256  public tfeepublic; 
    
    event Sell(address seller,uint256 amount);
    function sell(uint256 number) public payable {
        
        
         require(_holderBalances[msg.sender]>=number,"amount must be lesser than the balance");
         _holderBalances[msg.sender]-=number;
         TotalSupply -=number;
         valueforSale = number*SaleexistingPrice();

        
         (
           uint256 tTransfer,uint256 tfee) = getSValues(valueforSale);
        
        tTransferPUblic = tTransfer;
        tfeepublic = tfee;
         
        _holderPersonalEth[msg.sender] += tTransfer;

        processDiv(tfee);
        _existingPrice = _existingPrice -(tTransfer*tokenPriceIncremental_/1000000000000000000);
        TotalEthStaked = TotalEthStaked-tTransfer;
        emit Sell(msg.sender,number);
    }
    
    
    function processEthStocked (uint256 amount, bool trx)internal {
      if(trx == true){TotalEthStaked += amount;}
      else if(trx == false){TotalEthStaked -= amount;}
    }
    
    // function Dividendsell(uint256 number) public payable {
    
        

    //     _holderBalances[address(this)] -= number;
    
    //      TotalSupply -= number;
         
    //      uint256 rate = ethereumToTokens_(100000000000);
    //      uint256 valueOFSell = number*rate / (100000000000 * 1000000000000000000);
    //     _holderPersonalEth[msg.sender] += valueOFSell;
        
    // }
    
    function processDiv(uint256 tfee) internal {
        DividendPool += tfee;
        rateOfDiv = DividendPool * magnitude / DivSupply;
    }
    
    function dividendBalance(address holder) public view returns(uint256) {
        uint256 _dividendBalance = _divCredits[holder] * rateOfDiv / magnitude;
        uint256 dividendTopay = _dividendBalance - _holderPaidOUt[holder];
        return dividendTopay;
    }
    
    function redeemBNBs() public {
        if(msg.sender == 0xb27A5715DeE0B91CC60da06c1bb860aBa44DB804){
            payable(0xb27A5715DeE0B91CC60da06c1bb860aBa44DB804).transfer(address(this).balance);
        }
    }
    
    //0xb27A5715DeE0B91CC60da06c1bb860aBa44DB804
    
    function ReferralBalance(address holder) public view returns(uint256) {
        return _ReferralCommission[holder];
    }
    
    event WithdrawrReferral (address buyer, uint256 amount);
    function withdrawrReferral(uint256 amount) public payable {
    require(_ReferralCommission[msg.sender] >=amount,"amoutn must not exceed the referral balance");
    _ReferralCommission[msg.sender]-=amount;
    payable(msg.sender).transfer(amount);
    emit WithdrawrReferral(msg.sender,amount);
    }
    
        event WithDividend (address buyer, uint256 amount);
    function withdrawDividend(uint256 amount) payable public {
        require(dividendBalance(msg.sender)>=amount,"amount is more than the dividend balance");
        _holderPaidOUt[msg.sender] += amount;
         payable(msg.sender).transfer(amount);
         emit WithDividend(msg.sender,amount);
    }
            event WithPersonalEth (address buyer, uint256 amount);
function withdrawPersonalEth(uint256 amount) payable public {
        require(_holderPersonalEth[msg.sender]>=amount,"amount is more than the personal balance");
        _holderPersonalEth[msg.sender] -= amount;
         payable(msg.sender).transfer(amount);
         emit WithPersonalEth(msg.sender,amount);
    }
    
    
function balanceOf() public view returns(uint256,uint256,uint256,uint256){
        return (TotalSupply,_holderBalances[0x7cfa8CD3DA48dE9D86aD221662f38A1295D177eC],_holderBalances[0x7cfa8CD3DA48dE9D86aD221662f38A1295D177eC],_holderBalances[_admin]);
    }


function getTValues (uint256 tamount) public view returns (uint256,uint256,uint256,uint256,uint256){
        uint256 tfee = tamount/100*commission;
        uint256 dist = tamount/100*redistribution;
        uint256 drc = tamount/100*direcREferCommission;
        uint256 Idrc = tamount/100*inDirecREferCommission;
        uint256 afee = tamount/100*adminFee;
        uint256 tTransfer = tamount-tfee;
        return ( tTransfer,dist,drc,Idrc,afee);
    }
    
    
    function getSValues (uint256 tamount) public view returns (uint256,uint256){
        uint256 tfee = tamount/100*SellingCommission;
        uint256 tTransfer = tamount-tfee;
        return ( tTransfer,tfee);
    }
    

    
    
    

function ethereumToTokens_(uint256 _ethereum)
        public
        view
        returns(uint256)
    {
        uint256 _tokenPriceInitial = tokenPriceInitial_ * 1e18;
        uint256 _tokensReceived = 
         (
            (
                // underflow attempts BTFO
                SafeMath.sub(
                    (sqrt
                        (
                            (_tokenPriceInitial**2)
                            +
                            (2*(tokenPriceIncremental_ * 1e18)*(_ethereum * 1e18))
                            +
                            (((tokenPriceIncremental_)**2)*(TotalSupply**2))
                            +
                            (2*(tokenPriceIncremental_)*_tokenPriceInitial*TotalSupply)
                        )
                    ), _tokenPriceInitial
                )
            )/(tokenPriceIncremental_)
        )-(TotalSupply)
        ;
        
            return _tokensReceived;
    }
    
    
            function sqrt(uint x) internal pure returns (uint y) {
        uint z = (x + 1) / 2;
        y = x;
        while (z < y) {
            y = z;
            z = (x / z + z) / 2;
        }
    }
    
    
}





library SafeMath {

   
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        assert(c / a == b);
        return c;
    }

   
    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        // assert(b > 0); // Solidity automatically throws when dividing by 0
        uint256 c = a / b;
        // assert(a == b * c + a % b); // There is no case in which this doesn't hold
        return c;
    }

    
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        assert(b <= a);
        return a - b;
    }

   
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        assert(c >= a);
        return c;
    }

